import React from 'react';

export default function Main({items}) {
    
    console.log(items);
    return(
        <div className='main-cont'>           
            <ul>
                {
                items.map((item, i) => {
                    return (
                        <li>
                            {items}
                        </li>
                    )
                })
                }
            </ul>
        </div> 
    )
}
